webpackJsonp([0xf686cc915e9e],{4216:function(a,e){a.exports={data:{markdownRemark:{html:'<p><strong>今回の新刊「pseŭda:kaĝo0.5」の頒布は延期</strong>とさせていただきます。頒布開始時期は現段階未定です。</p>\n<p>C73の新刊は<a href="/!/dst/">danmaq soundtrack</a>(100yen)のみとなります。</p>\n<p>あとは既刊として<a href="/!/thC/">夢終劇</a>(1,000yen)、<a href="/!/thA/">時封城</a>(CD-R簡易装丁版/\\400yen)、<a href="/!/leila/">レイラ</a>(300yen)を持参します。</p>\n<p>ご期待いただいていた皆様には深くお詫びいたします。どうかご理解の程よろしくお願いします。</p>\n<h2>某心当たりある方へ</h2>\n<p>わざわざ近所のネトカフェ来たんなら、絵板に変なの描いてないで折角だからウチに遊びに来んか？今朝、たまたまウチのサイトに書いてるとこ見えちまってコーラが一瞬ストローから逆流してもうたわ。ｗｗ(そこは知らぬふりでそそくさと退散しましたがね。もともと冬コミ準備のためにネトカフェに用があったわけだし)いや偶然とはこわいもんだ……まぁ何がともあれ、おもろいもんヲチさせていただきましたわ。</p>',frontmatter:{cover:null,date:"2007-12-30T00:00:00+09:00",strDate:"2007/12/29",title:"[緊急]おわび"}}},pathContext:{path:"/ja/blog/2007/12/30-緊急おわび/",langKey:"ja"}}}});
